import React, { useState } from "react";
// import Cards from "./Cards";
import "./App.css";
// import Sdata from "./Sdata";

function App() {
  let Time = new Date().toLocaleTimeString();
  console.log(Time);
  const [ctime, setctime] = useState(Time);

  return (
    <>
      <h1>{Time}</h1>
    </>
  );
}

export default App;
